css:
.header-view .heading-status {
  padding-left: 9px;
}
.header-view .icon-alert {
  color: #CD8E00;
}
.header-view .icon-check {
  color: #45A815;
}
.header-view .icon-hourglass {
  color: #444;
}
.header-view .icon-stop {
  color: #c00;
}
.script-input-view .caption {
  margin-bottom: 5px;
}
.script-profile-run-view {
  width: 100%;
  margin-left: -50%;
  padding: 0;
}
.script-profile-run-view .profile .name {
  font-size: 1.2rem;
  font-weight: bold;
}
.script-profile-run-view .profile .description {
  font-style: italic;
  color: #999;
}
.script-profile-run-view .buttons {
  margin-top: 1rem;
}
.script-profile-run-view .buttons .rename,
.script-profile-run-view .buttons .cancel {
  float: left;
  margin-right: 5px;
}
.script-profile-run-view .buttons .delete {
  float: left;
}
.script-profile-run-view .buttons .run {
  float: right;
}
.options-view {
  width: 100%;
}
.options-view table {
  margin-top: 10px;
}
.options-view table td.first {
  width: 40%;
}
.options-view table td.second {
  width: 60%;
}
.options-view table td {
  padding: 0 5px;
  vertical-align: middle;
}
.options-view table td atom-text-editor {
  max-width: 99%;
}
.options-view table td:first-child {
  width: 15rem;
  text-align: right;
}
.options-view .buttons {
  padding: 5px;
}
.options-view .buttons .cancel {
  float: left;
}
.options-view .buttons .right-buttons {
  float: right;
}
.options-view .buttons .save-profile {
  margin-right: 5px;
}
.script-view .panel-body pre {
  background: #f4f4f4;
  color: #444;
}
.script-view .stderr {
  color: #c00;
}
.script-view .line {
  border-radius: 0px;
  margin: 0px;
  padding: 0px;
}
